import { Tabs, Radio } from "antd";

const { TabPane } = Tabs;

const data = [
  {
    key: "1",
    buildingname: "승연관",
    button: (
      <Button id="승연관" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "2",
    buildingname: "일만관",
    button: (
      <Button id="일만관" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "3",
    buildingname: "월당관",
    button: (
      <Button id="월당관" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "5",
    buildingname: "나눔관",
    button: (
      <Button id="나눔관" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "6",
    buildingname: "이천환관",
    button: (
      <Button id="이천환관" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "7",
    buildingname: "새천년관",
    button: (
      <Button id="새천년관" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "9",
    buildingname: "성미가엘성당",
    button: (
      <Button id="성미가엘성당" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "11",
    buildingname: "미가엘관",
    button: (
      <Button id="미가엘관" onClick={onMoreClick}>
        More
      </Button>
    )
  }
];

const BuildingList = () => {
  return (
    <>
      <Tabs defaultActiveKey="1" style={{ height: 220 }}>
        {[...Array(30).keys()].map(i => (
          <TabPane tab={`Tab-${i}`} key={i}>
            Content of tab {i}
          </TabPane>
        ))}
      </Tabs>
    </>
  );
};

export default BuildingList;
